function CountDown(){
  var distanceTime = new Date("Jan 5, 2021 15:37:25").getTime() - new Date().getTime();

  var days = Math.floor(distanceTime/(1000*60*60*24));
  var hours = Math.floor(distanceTime%(1000*60*60*24));
  var minutes = Math.floor(distanceTime%(1000*60*60));
  var seconds = Math.floor(distanceTime%(1000*60));

  return days + 'd ' + hours + 'h ' + minutes + 'm ' + seconds + 's';
}

const element = (<p> {CountDown()} </p>);

ReactDOM.render(
  element,
  document.getElementById('root')
);
